import Header from "./components/Header";
import CardLine from "./components/CardLine";
import image1 from "../Assets/u_poplloon_demo.jpg"
import image2 from "../Assets/Logo_demo.jpg"
import "./Assets/stuff.css";

const cardData = [
    {
        id: 1,
        image: image1,
        primaryText: "Project Poplloon:"
    },

    {
        id: 2,
        image: image2,
        primaryText: "Mira Softworks Website:"
    },

    {
        id: 3,
        image: image2,
        primaryText: "Mira Softworks Website:"
    },
]

function App() {
    return (
        <div className="App text-center">
            <div className="container d-flex">
                <Header text="Mira Softworks is not only a personal brand, it is what identifies me as a 3D artist and video game developer, so it is also my little corner on the web where I can share everything I learn with you. I hope you have fun exploring my projects and capture my passion for what I do. I work hard to deliver innovative and creative solutions to the challenges that come my way and I'm excited to show you what I've accomplished so far." />
            </div>

            <div>
                <CardLine title="On working stage" key={cardData.id} image={cardData.image} primaryText={cardData.primaryText} />
            </div>
        </div>
    )
}

export default App;
